-- ----------------------------
-- Table structure for `employee`
-- ----------------------------
DROP TABLE IF EXISTS `employee`;
CREATE TABLE `employee` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '公司邮箱，OA登录账号',
  `real_name` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '员工的真实姓名',
  `phone` varchar(32) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '手机号，目前还没有使用；隐私问题OA接口没有提供这个属性，',
  `department_id` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT '0' COMMENT 'OA中的部门编号，有负值',
  `department_name` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT 'OA中的部门名',
  `remote_login` bit(1) NOT NULL COMMENT '员工是否可以远程登录',
  `job_number` varchar(64) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '员工工号',
  `cross_school` bit(1) NOT NULL COMMENT '是否有跨校区权限',
  `last_login_date` datetime NOT NULL COMMENT '最后登录日期',
  `creator` int(32) DEFAULT NULL COMMENT '创建人',
  `create_date_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_date_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否被删除（禁用）',
  `scrm_department_id` int(32) DEFAULT NULL COMMENT 'SCRM内部部门id',
  `leave_office` bit(1) DEFAULT NULL COMMENT '离职状态',
  `leave_office_time` datetime DEFAULT NULL COMMENT '离职时间',
  `reinstated_time` datetime DEFAULT NULL COMMENT '复职时间',
  `superior_leaders_id` int(11) DEFAULT NULL COMMENT '上级领导ID',
  `tdepart_id` int(11) DEFAULT NULL COMMENT '直属部门',
  `tenant` int(11) NOT NULL DEFAULT '0',
  `ems_user_name` varchar(32) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `employee_email_ikey` (`email`),
  KEY `employee_ems_username_ikey` (`ems_user_name`),
  KEY `index_scrm_department_id` (`scrm_department_id`),
  KEY `index_tdepart_id` (`tdepart_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3882 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='员工信息表';

